var module_103352314117=function(){var eventDateString=document.querySelector("#countdown").innerHTML,eventDateUnix=parseInt(eventDateString),targetDate=new Date(eventDateUnix);setInterval(updateCountdown,1e3);function updateCountdown(){var now=new Date,diff=targetDate.getTime()-now.getTime(),remainingMonths=Math.floor(diff/2592e6),remainingWeeks=Math.floor(diff/6048e5),remainingDays=Math.floor(diff/864e5),remainingHours=Math.floor(diff%864e5/36e5),remainingMinutes=Math.floor(diff%36e5/6e4),remainingSeconds=Math.floor(diff%6e4/1e3);document.getElementById("months").textContent=remainingMonths,document.getElementById("weeks").textContent=remainingWeeks,document.getElementById("days").textContent=remainingDays,document.getElementById("hours").textContent=remainingHours,document.getElementById("minutes").textContent=remainingMinutes,document.getElementById("seconds").textContent=remainingSeconds}updateCountdown()}();